style.css:
@-moz-document domain("feabie.com") {
input[type="password"],
input[type="text"],
input[type="file"],
input[type="date"],
select,
textarea {
    background-color: #202020;
    color: #b3b3b3;
}

div#main {
    background-color: #303030;
    color: #b3b3b3;
}

div#hero-background {
    background-color: #202020;
}

div.editor-field {
    color: #b3b3b3;
}

.actionitems a {
    color: #c3c3c3;
}

span.profile-icon {
    color: #d3d3d3;
}

.statbox-location,
.statbox.color3 {
    border: 1px dotted #303030;
    background-color: #000;
    color: #b3b3b3
}

input[type="submit"].link-button2,
a.link-button2,
button.link-button2 {
    background-color: #202020;
}

.slider {
    background-color: #000;
}

.jslider .jslider-value {
    background: #505050!important;
}

.ui-widget-content {
    background: #404040;
    color: #939393;
}

.ui-widget-content a {
    color: #d3d3d3;
}

.ui-widget-header {
    background: #101010;
    border: 1px solid #101010;
}

.ui-tabs-panel {
    color: #b3b3b3;
}

.ui-state-default,
.ui-widget-content .ui-state-default,
.ui-widget-header .ui-state-active {
    background: #303030;
    color: #b3b3b3;
}

.ui-state-default a,
.ui-state-default a:link,
.ui-state-default a:visited {
    color: #939393
}

ul.ui-multiselect-checkboxes .ui-state-hover,
ul.ui-multiselect-checkboxes .ui-widget-content .ui-state-hover {
    color: #fff;
}

.ui-state-active,
.ui-widget-content .ui-state-active,
.ui-widget-header .ui-state-active {
    background: #404040;
}

.ui-state-active a,
.ui-state-active a:link,
.ui-state-active a:visited {
    color: #31a759;
}

#profile-tabs .ui-tabs-panel {
    border-left: 1px dotted #101010;
    border-bottom: 1px dotted #101010;
    border-right: 1px dotted #101010;
}

.post {
    border-top: 1px dotted #000;
}

.post.sticky {
    background: linear-gradient(to bottom, #404040 0, rgba(64, 64, 64, 0) 80px)!important;
}

.post-add {
    background-color: #404040;
    color: #939393;
}

.post-add textarea {
    border: 1px solid #000;
}

span[style="color:red"] {
    color: #ff8080!important;
}

img[src*="/Content/Images/icons/open-new-window.jpg"] {
    width: 0;
    /* Hide image by setting width to 0 */
    
    height: 9px;
    padding-right: 9px;
    /* But force original width using padding */
    
    background: transparent url("data:image/png;base64,iVBORw0KGgoAAAANSUhEUgAAAAkAAAAJCAYAAADgkQYQAAAABmJLR0QA/wD/AP+gvaeTAAAACXBIWXMAAAsTAAALEwEAmpwYAAAAB3RJTUUH4gMEEyovhUAR9gAAAEFJREFUGNNjZMACDh8+/B+Zz8iAB8AUM6LrsrW1ZYQpsLW1hcijK0K3DqsibJowdWFhM2FzDzpgYiACsOB0BxIAAOgOMCQcMdFqAAAAAElFTkSuQmCC");
    /* And set background to a replacement image */
}

img[src*="/Content/Images/ajax-loader.gif"] {
    width: 0;
    /* Hide image by setting width to 0 */
    
    height: 16px;
    padding-right: 16px;
    /* But force original width using padding */
    
    background: transparent url("data:image/gif;base64,");
    /* And set background to a replacement image */
}

img[src*="/Content/Images/ajax-loader-bar.gif"] {
    
    filter: invert(100%) grayscale(100%);
    --mask-img: url("data:image/png;base64,") center/contain;
    -webkit-mask: var(--mask-img);
    mask: var(--mask-img);
}

.comment,
.comment-add {
    background-color: #202020;
}

.input-validation-error {
    border: 1px solid #ff8080;
    background-color: #403030;
}

.photostream-overquota {
    background-color: #202020;
    color: #d3d3d3;
}

.with-borders .photo-thumbnail,
.with-borders .member-thumbnail,
.with-borders .photo-icon,
.with-borders .photo-thumbnail-sm,
.with-borders .photo-thumbnail-lg {
    border: 1px solid #202020;
}

#newsfeed-updates-bar {
    background-color: #505000;
    border: 1px solid #808000;
}

#newsfeed-updates-bar a {
    color: #81e4ff;
}

.popular-list a {
    background-color: #306030;
    color: #60f0e0
}

img.noPresenceLine {
    border-bottom: 5px solid #101010!important;
}

.member-thumbnail .miniprofile {
    background-color: #101010;
}

.member-thumbnail .miniprofile h4 {
    text-shadow: 0 1px #303030;
}

.photo-thumbnail-lg.embed {
    background-color: #202020;
}

div.presenceBox {
    border-top: 1px solid #303030;
    border-left: 1px solid #303030;
}

table.messages {
    color: #c3c3c3;
}

table.messages tr {
    background-color: #202020;
}

table.messages tr.unread {
    background-color: #000000;
}

td.msg-photo {
    border-left: 4px solid #404040
}

td.left.navt {
    background: #202020!important;
    background: -moz-linear-gradient(left, #303030 64%, #303030 64%, #202020 100%)!important;
    background: -webkit-gradient(linear, left top, right top, color-stop(64%, #303030), color-stop(64%, #303030), color-stop(100%, #202020))!important;
    background: -webkit-linear-gradient(left, #303030 64%, #303030 64%, #202020 100%)!important;
    background: -o-linear-gradient(left, #303030 64%, #303030 64%, #202020 100%)!important;
    background: -ms-linear-gradient(left, #303030 64%, #303030 64%, #202020 100%)!important;
    background: linear-gradient(to right, #303030 64%, #303030 64%, #202020 100%)!important;
}

td.planitem {
    background-color: #303030!important;
    border: 2px solid black!important;
}

td.planbasic {
    background-color: #202020!important;
}

td.planpremium {
    background-color: #503030!important;
    border-left: 2px solid black!important;
}

td[style="background-color: #E45C43;"].planpremium {
    background-color: #e45c43!important;
    /* The top heading in the Feabie XL column in the table. */
}

div[style="padding: 6px 16px; margin: 24px 0 -8px 0; clear: both; background-color: #eee;"] {
    /* This matches some boxes in "My Account" */
    
    background-color: #101010!important;
}

select.pmt-method {
    background-color: #202020!important
}
