.k-grid-header-locked,
.k-grid-header-wrap,
.k-group,
.k-group-footer td,
.k-grouping-header,
.k-grouping-header .k-group-indicator,
.k-header,
.k-input,
.k-maskedtextbox.k-state-disabled>.k-textbox:hover,
.k-pager-refresh,
.k-pager-wrap,
.k-pager-wrap .k-link,
