.k-textbox>input,
.k-tiles,
.k-toolbar,
.k-tooltip,
.k-treemap-tile,
.k-upload-files,
.k-widget {
    border-color: #000;
}

.k-button {
    border-color: #000;
}

.k-button.k-state-hover,
.k-button:hover {
    color: #fff!important;
    border-color: #000;
    background-color: #606060!important;
}

.k-block,
.k-content,
.k-dropdown .k-input,
.k-popup,
.k-toolbar,
.k-widget {
    color: #b3b3b3!important;
}

.k-block,
.k-widget {
    background-color: #404040!important;
}

.k-block,
.k-button,
.k-draghandle,
.k-grid-header,
.k-grouping-header,
.k-header,
.k-pager-wrap,
.k-toolbar,
.k-treemap-tile,
html .km-pane-wrapper .k-header {
    background-color: #404040!important;
}

.k-alt,
.k-pivot-layout>tbody>tr:first-child>td:first-child,
.k-resource.k-alt,
.k-separator {
    background-color: #303030!important;
}

.k-gantt .k-treelist tr:hover,
.k-grid tr:hover {
    background-color: #101010!important;
}

.k-grouping-header,
.k-pager-info {
    color: #b3b3b3!important;
}

.k-grid-header .k-header>.k-link,
.k-header,
.k-treemap-title {
    color: #e3e3e3!important;
}

.k-grid-header .k-link .k-icon.k-i-sort-asc-sm,
.k-grid-header .k-link .k-icon.k-i-sort-desc-sm,
.k-grid-header .k-link .k-sort-order {
    color: #00c2e6!important;
}

.k-pager-numbers .k-link {
    color: #e3e3e3!important;
}

.k-link:link,
.k-link:visited,
.k-nav-current.k-state-hover .k-link {
    color: #00c2e6!important;
}

.k-pager-numbers .k-link {
    border-color: transparent;
    border-top-color: transparent;
    border-right-color: transparent;
    border-bottom-color: transparent;
    border-left-color: transparent;
}

.k-pager-numbers .k-link:hover,
.k-pager-wrap>.k-link,
.k-pager-wrap>.k-link.k-state-disabled:hover,
.k-pager-wrap>.k-link:hover {
    border-radius: 0;
    border-color: transparent;
    border-top-color: transparent;
    border-right-color: transparent;
    border-bottom-color: transparent;
    border-left-color: transparent;
    background: 0 0;
}

.k-pager-numbers .k-state-selected {
    color: #00c2e6!important;
    border-color: #00c2e6!important;
}

div.k-chart svg g path[fill="#fff"] {
    fill: transparent;
}

div.k-chart svg g text[fill="#4e4e4e"] {
    fill: #c3c3c3;
}

div.k-chart svg g circle[fill="#fff"] {
    fill: #404040;
}

div.k-chart svg g circle[stroke="#0072c6"] {
    stroke: #00c2e6;
}

div.k-chart svg g g g g path[stroke="#0072c6"] {
    stroke: #00c2e6;
}
